import React, { useEffect, useState } from 'react';
import Header from './components/Header';
import Grid from '@material-ui/core/Grid';
import BarChart from './components/BarChart';
import { Typography } from '@material-ui/core';
import { getAnual } from './services/getAnual';
import './App.css';

function App() {
  const [anualResult, setAnualResults] = useState([]);

  useEffect(() => {
    async function fetchData() {
      setAnualResults(await getAnual());
    }
    fetchData();
  }, []); 

  console.log('anualResult', anualResult);
  return (
    <>
      <Header />
      <header className="header">
        <Typography variant="h6">Pagina de teste 1</Typography>
        <Typography variant="body1">Description</Typography>
      </header>
      <Grid container className="root">
        <Grid item xs={12} sm={6}> <BarChart /></Grid>
        <Grid item xs={12} sm={6} >
          teste
        </Grid>
      </Grid>
    </>
  );
}

export default App;
